	DCOUP "hhh-RenConst: dZHiggs1(3,4) =", dZHiggs1(3,4) ENDL
#endif

	dTB1div = -(1/2.D0*(TB*(Re(dZ11H1) - Re(dZ22H1)))) + 
     &    1/2.D0*((1 - TB2)*Re(dZ12H1fin(zD)))

#ifdef DETAILED_DEBUG
	DCOUP "hhh-RenConst: dTB1div =", dTB1div ENDL
#endif

	dTB1 = dTB1div + dTB1fin(zD)

#ifdef DETAILED_DEBUG
	DCOUP "hhh-RenConst: dTB1 =", dTB1 ENDL
#endif

	dMHiggs1(3,4) = 
     &   MA02*(-(CB2*dTB1) + dBn1(zD)) - 
     &    (CBA*dTh01 - dTHH1*SBA)*(1/2.D0*EL0/(MW*SW))

#ifdef DETAILED_DEBUG
	DCOUP "hhh-RenConst: dMHiggs1(3,4) =", dMHiggs1(3,4) ENDL
#endif

	end

